import React from "react";
import { Form } from "antd";

const LoginForm = () => {
  return (
    <Form>
      <div>
          <label htmlFor="user-id">아이디</label>
          <br/>
          <input name="_user-id"></input>
      </div>
      <div></div>
      <div></div>
      <div></div>
    </Form>
  );
};

export default LoginForm;
